  published: Wed, 30 Apr 2008 10:10:58 +0000
  content: "D\xC3\xA4lek (pronounced 'Die-a-leck') is an American <a href=\"http://www.last.fm/tag/experimental%20hip-hop\" class=\"bbcode_tag\" rel=\"tag\">experimental hip-hop</a> duo from Newark, NJ. The group is comprised of D\xC3\xA4lek (vocals) and The Oktopus (production). <a href=\"http://www.last.fm/music/Still\" class=\"bbcode_artist\">Still</a> handled most of their scratching and more experimental turntable work up until the summer of 2005. Their music is dark, sinister, noisy and atmospheric; inspired as much by <a href=\"http://www.last.fm/music/My+Bloody+Valentine\" class=\"bbcode_artist\">My Bloody Valentine</a> and <a href=\"http://www.last.fm/music/Einst%C3%BCrzende+Neubauten\" class=\"bbcode_artist\">Einst&uuml;rzende Neubauten</a> as <a href=\"http://www.last.fm/music/Wu-Tang+Clan\" class=\"bbcode_artist\">Wu-Tang Clan</a> and <a href=\"http://www.last.fm/music/Public+Enemy\" class=\"bbcode_artist\">Public Enemy</a>, as well as German Krautrock group <a href=\"http://www.last.fm/music/Faust\" class=\"bbcode_artist\">Faust</a> (with whom they have worked)."
